<template>
    <div>
    <div class="row">
        <div class="col-md-6">
            <h2>Camera:</h2>
            <code v-if="device">{{ device.label }}</code>
            <div class="border">
                <vue-web-cam v-if="!error" ref="webcam"
                             :device-id="deviceId"
                             width="100%"
                             @error="onError"
                             @cameras="onCameras"
                             @camera-change="onCameraChange"/>
                <div v-else class="alert alert-danger fade show" role="alert">
                    It seems there is a problem with your web cam. Please check whether your web cam is working
                    and try again.
                </div>
            </div>

            <div class="row">
                <div class="col-md-12">
                    <select v-model="camera" class="form-control mt-2 mb-2">
                        <option>-- Select Device --</option>
                        <option v-for="device in devices"
                                :key="device.deviceId"
                                :value="device.deviceId">{{ device.label }}
                        </option>
                    </select>
                </div>
                <div class="col-md-12 text-center">
                    <button type="button"
                            class="btn btn-primary mr-2"
                            :disabled="error"
                            @click="onCapture">Capture Photo
                    </button>
                </div>
            </div>
        </div>
        <div class="col-md-6">
            <h2>Captured Image</h2>
            <figure class="figure">
                <img id="my_img" :src="img" class="img-fluid">
            </figure>
        </div>
    </div>

    <div class="row" v-if="myExpressionError">
        <div class="alert alert-danger alert-dismissible fade show" role="alert">
            {{ myExpressionError }}
            <button type="button" class="close" data-dismiss="alert" aria-label="Close">
                <span aria-hidden="true">&times;</span>
            </button>
        </div>
    </div>

    <div class="row" v-if="myExpression.length && !myExpressionError.length">
        <div class="col-md-12 text-center">
            <h2>Ok, can you guess the emotion?</h2>
            <div v-if="userAnswer.length" :class="userAnswerClass" role="alert">
                <span v-if="isAnswerRight">
                    Yes, Iâ€™m {{ userAnswer }}. Can you make the same face?
                </span>
                <span v-else>
                    Sorry, but I'm not {{ userAnswer }}. Please try again.
                </span>
                <button type="button" class="close" data-dismiss="alert" aria-label="Close">
                    <span aria-hidden="true">&times;</span>
                </button>
            </div>
                <button @click="checkEmotion('happy')" class="btn btn-primary mr-2">Happy</button>
                <button @click="checkEmotion('angry')" class="btn btn-primary mr-2">Angry</button>
                <button @click="checkEmotion('sad')" class="btn btn-primary mr-2">SAD</button>
                <button @click="checkEmotion('surprised')" class="btn btn-primary mr-2">Surprised</button>
                <button @click="checkEmotion('neutral')" class="btn btn-primary mr-2">Neutral</button>
        </div>
    </div>
    </div>
</template>

<script>
    import { WebCam } from "vue-web-cam";
    import * as faceapi from 'face-api.js';
    import { mapGetters, mapActions } from 'vuex'

    export default {
        name: "App",
        components: {
            "vue-web-cam": WebCam,
        },
        data() {
            return {
                img: null,
                camera: null,
                deviceId: null,
                devices: [],
                error: null,
                myExpressionError: '',
                isAnswerRight: false,
                userAnswer: '',
                expressions: {
                    happy: 0,
                    angry: 0,
                    sad: 0,
                    surprised: 0,
                    neutral: 0
                },
                myExpression: ''
            };
        },
        computed: {
            ...mapGetters([
                'isLoading'
            ]),
            device: function () {
                return this.devices.find(n => n.deviceId === this.deviceId);
            },
            userAnswerClass: function() {
                return {
                    'alert': true,
                    'alert-danger': !this.isAnswerRight,
                    'alert-success': this.isAnswerRight,
                    'alert-dismissible': true,
                    'fade show': true
                }
            }
        },
        watch: {
            camera: function (id) {
                this.deviceId = id;
            },
            devices: function () {
                // eslint-disable-next-line no-unused-vars
                const [first, ...tail] = this.devices;
                if (first) {
                    this.camera = first.deviceId;
                    this.deviceId = first.deviceId;
                }
            }
        },
        methods: {
            ...mapActions([
                'changeIsLoading'
            ]),
            async onCapture() {
                this.changeIsLoading();
                this.resetState();
                this.img = this.$refs.webcam.capture();
                //this.img = 'data:image/jpeg;base64,'
                //const data = this.img.replace(/^data:image\/\w+;base64,/, "");
                const myImg = document.getElementById('my_img');

                await faceapi.nets.tinyFaceDetector.loadFromUri('/data/weights');
                await faceapi.nets.faceExpressionNet.loadFromUri('/data/weights');
                const detections = await faceapi.detectAllFaces(myImg, new faceapi.TinyFaceDetectorOptions()).withFaceExpressions();
                if(!detections.length) {
                    this.myExpressionError = 'Cannot find face or detect expressions';
                } else {
                    this.expressions = {
                        happy: detections[0].expressions.happy,
                        angry: detections[0].expressions.angry,
                        sad: detections[0].expressions.sad,
                        surprised: detections[0].expressions.surprised,
                        neutral: detections[0].expressions.neutral
                    }
                    this.myExpression = this.findMyEmotion(this.expressions);
                    this.myExpressionError = ''
                }
                this.changeIsLoading();
            },
            onError(error) {
                this.error = error;
            },
            onCameras(cameras) {
                this.devices = cameras;
            },
            onCameraChange(deviceId) {
                this.deviceId = deviceId;
                this.camera = deviceId;
            },
            findMyEmotion(obj) {
                return Object.keys(obj).reduce((a, b) => obj[a] > obj[b] ? a : b)
            },
            checkEmotion(emotion) {
                this.userAnswer = emotion;
                this.isAnswerRight = emotion == this.myExpression;
            },
            resetState() {
                this.myExpressionError = '';
                this.userAnswer = '';
                this.isAnswerRight = false;
                this.expressions = {
                    happy: 0,
                    angry: 0,
                    sad: 0,
                    surprised: 0,
                    neutral: 0
                };
                this.myExpression = ''
            }
        }
    }
</script>

